import { NavLink, Route, Switch } from "react-router-dom";
import logoMesto from "../images/logo.svg";

function Header() {
  return (
    <header className="header">
      <img className="header__logo" src={logoMesto} alt="логотип Mesto" />
      <nav className="header__nav-container">
        <Switch>
          <Route exact path="/">
            <NavLink to="/sign-in" className="header__link">Выйти</NavLink>
          </Route>
          <Route path="/sign-in">
            <NavLink to="/sign-in" className="header__link">Войти</NavLink>
          </Route>
          <Route path="sign-up">
            <NavLink to="/sign-up" className="header__link">Регистрация</NavLink>
          </Route>
        </Switch>
      </nav>
    </header>
  );
}

export default Header;
